import React from "react"
import {useState} from "react"
import { useDebouncer, useFetch } from "../CustomHooks/useHooks"

const GitHubSearch =()=>{
const [query, setQuery] = useState("")
const debouncedQuery = useDebouncer(query, 500)
const {isLoading, isError, data} = useFetch(`https://github/search/user?q=${debouncedQuery || "masai"}`)



    return (
        <>

        <h1>git search</h1>
        <input type="text" name="" id="" value= {query} onChange ={(e)=>setQuery(e.target.value)}/>

        {
            isLoading ? <div> Loading...</div>
            : isError ? <div> Error... </div>
            :
            data.items && data.items.map(item=><p key={item.id}> {item.login}</p>)
        }
        </>
    )
}

export {GitHubSearch}
